import React, { useState, useEffect, useRef }  from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Typography, Box, Button } from '@mui/material';
import { xdata} from './Arrange';

const VerticalText = ({ children }) => (
  <Typography
    variant="body1"
    align="center"
    sx={{
      writingMode: 'vertical-lr', // Vertical text, facing right
      whiteSpace: 'nowrap', // Avoid wrapping
      fontSize: '0.5rem',
    }}
  >
    {children}
  </Typography>
);

const VerticalColumn = ({ children }) => (
  <TableCell align="center" sx={{ padding: '0',height: '0',borderLeft: 1, borderTop: 1, borderRight: 1, border:1,}}>
    <VerticalText>{children}</VerticalText>

  </TableCell>
);

const CustomTableCell = (props) => (
  <TableCell align="center" {...props} sx={{ padding: '1px',height: '0', border:1,fontSize: '0.6rem', }}/>

);

const CustomNewTableCell = ({ onClick, children, isActive, color }) => (
  <TableCell 
    align="center" 
    onClick={onClick} 
    sx={{ 
      border: 1, 
      padding: '0',
      height: '0',
      fontSize: '0.6rem',
      backgroundColor: isActive ? color : null,  // Color change on active state
    }}
  >
    {children}
  </TableCell>
);

const CustomProdTableCell = ({ children, color, ...props }) => (
  <TableCell
    align="center"
    {...props}
    sx={{
      padding: '0',
      height: '0',
      borderLeft: 1,
      borderTop: 1,
      borderRight: 1,
      fontSize: '0.6rem',
      fontWeight: 'bold',
      border: 1,
      width: '300px',
      backgroundColor: color || 'inherit', // Use productData.color as background color
    }}
  >
    {children}
  </TableCell>
);







const App = () => {
  // Create an array for rows



  const initialRows = new Array(40).fill(null).map((_, index) => ({
    id: index,
    grid: index < 20 ? '1' : '3',
    diode: false,
    // diodeActive: false,
    // unmaskActive: false,
    // unmask: index % 2 === 0 ? 'Unmask' : '',
    unmask: false,
    ru: `${index}`,
    //seatUuid: `UUID-${index + 1}`,
    prod: '',
    place: '',
    prod2: '',
    ru2: `${index + 40}`,
    unmask2: false,
    diode2: false,
    grid2: (index+40) < 60  ? '2' : '4',
  }));

  const [rows, setRows] = useState(initialRows);

  const data = React.useMemo(()=> xdata, []); 

  console.log(data[0]);

//   useEffect(() => {
//     // Assuming data is an array of product objects, and each product object has at least a 'product' key
//     const updatedRows = rows.map((row, index) => {
//       const productData = data[index % data.length]; // This will cycle through the products for each row
//       return {
//         ...row,
//         prod: productData.product, // Assign product name to 'prod' (Product1) column
//         prod2: productData.product, // Assign product name to 'prod2' (Product2) column for rows 21-40
//         prodColor: productData.color
//       };
//     });
//     setRows(updatedRows);
// }, []);

  useEffect(() => {
    // Assuming data is an array of product objects, and each product object has at least a 'product' key
    const updatedRows = rows.map((row, index) => {
      const productData = data[index % data.length]; 
      const productData2 = data[(index+40) % data.length]; // This will cycle through the products for each row
      return {
        ...row,
        prod: productData.product, // Assign product name to 'prod' (Product1) column
        prod2: productData2.product, // Assign product name to 'prod2' (Product2) column for rows 21-40
        prodColor: productData.color,
        prodColor2: productData2.color
      };
    });
    setRows(updatedRows);
}, []);

  const toggleDiode = (ru) => {
    setRows(rows.map(row => ({
      ...row, 
      diode: row.ru === ru ? !row.diode : false, 
      diode2: false
    })));
  };

  // const toggleUnmask = (ru) => {
  //   setRows(rows.map(row => ({
  //     ...row, 
  //     unmask: row.ru === ru ? !row.unmask: false, // Only turn on the clicked one, reset others
  //     unmask2: false 
  //   })));
  // };

  const toggleDiode2 = (ru2) => {
    setRows(rows.map(row => ({
      ...row, 
      diode2: row.ru2 === ru2 ? !row.diode2 : false,  
      diode: false
    })));
  };

  // const toggleUnmask2 = (ru2) => {
  //   setRows(rows.map(row => ({
  //     ...row, 
  //     unmask2: row.ru2 === ru2 ? !row.unmask2 : false, // Only turn on the clicked one, reset others
  //     unmask: false
  //   })));
  // };

  const [activeUnmaskProduct, setActiveUnmaskProduct] = useState(null);

  const toggleUnmask = (product) => {
    setActiveUnmaskProduct(activeUnmaskProduct === product ? null : product);
  };

  // Modify the toggleUnmask2 function for the 'unmask2' column
  const toggleUnmask2 = (product) => {
    setActiveUnmaskProduct(activeUnmaskProduct === product ? null : product);
  };





  return (
    <Box>
    <TableContainer component={Paper}>
      <Typography variant="h6" align="center" style={{ marginLeft: '286px', height: '20px',width: `678px`, fontSize: '16px', borderLeft: '1px solid black', borderTop: '1px solid black', borderRight: '1px solid black', borderBottom: '0', backgroundColor: 'lightblue',}}>
        TAPE-IN DB VIEW
      </Typography>
      <Table aria-label="custom table" align = "center" sx={{ width: 'auto' }}> 
        <TableHead sx={{ backgroundColor: 'lightblue' }}>

          <TableRow>
            <VerticalColumn>Grid</VerticalColumn>
            <VerticalColumn>Diode</VerticalColumn>
            <VerticalColumn>Unmask</VerticalColumn>
            <VerticalColumn>RU#</VerticalColumn>
            <CustomTableCell colSpan={3} align="center">Seat UUID</CustomTableCell>
            {/* <CustomTableCell></CustomTableCell>
            <CustomTableCell>Place</CustomTableCell>
  <CustomTableCell></CustomTableCell> */}

            <VerticalColumn>RU#</VerticalColumn>
            <VerticalColumn>Unmask</VerticalColumn>
            <VerticalColumn>Diode</VerticalColumn>
            <VerticalColumn>Grid</VerticalColumn>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row, index) => (
            <>

              {index === 20 && (
                <TableRow key="midhalf">
                  <CustomTableCell colSpan={11}>MIDHALF</CustomTableCell>
                </TableRow>
              )}
              <TableRow key={row.id}>
                {(index === 0 || index === 20) && (
                  <CustomTableCell rowSpan={20}>{row.grid}</CustomTableCell>
                )}

                <CustomNewTableCell isActive={row.diode}
                  onClick={() => toggleDiode(row.ru)} color="blue"
                >  </CustomNewTableCell>
                {/*<CustomNewTableCell isActive={row.unmask}
                  onClick={() => toggleUnmask(row.ru)}
                >  </CustomNewTableCell> */}
                <CustomNewTableCell isActive={activeUnmaskProduct === row.prod}
                onClick={() => toggleUnmask(row.prod)} color="yellow"
                >  </CustomNewTableCell>
                <CustomTableCell>{row.ru}</CustomTableCell>

                <CustomProdTableCell color={row.prodColor}>{row.prod}</CustomProdTableCell>
                <CustomTableCell>{row.place}</CustomTableCell>

                <CustomProdTableCell color={row.prodColor2}>{row.prod2}</CustomProdTableCell>

                <CustomTableCell>{row.ru2}</CustomTableCell>
                {/*<CustomNewTableCell isActive={row.unmask2}
                  onClick={() => toggleUnmask2(row.ru2)}></CustomNewTableCell> */}
                  <CustomNewTableCell isActive={activeUnmaskProduct === row.prod2}
                onClick={() => toggleUnmask2(row.prod2)} color="yellow"
                >  </CustomNewTableCell>
                <CustomNewTableCell isActive={row.diode2}
                  onClick={() => toggleDiode2(row.ru2)} color="blue"></CustomNewTableCell>
                {(index === 0 || index === 20) && (
                  <CustomTableCell rowSpan={20}>{row.grid2}</CustomTableCell>
                )}


              </TableRow>
            </>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    <Box
        sx={{

          width: '30px', // Adjust the width as needed
          height: '600px', // Same height as the table
          position: 'absolute',
          right: '220px',
          top: '95px',
          textAlign: 'center',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          border: 1,
        }}
      >
        <Typography variant="h8">I/Os</Typography>
      </Box>

      {/* Box attached to the bottom of the table */}
      <Box
        sx={{

          width: '640px', // Same width as the table
          height: '0', // Adjust the height as needed
          padding: '0',
          textAlign: 'center',
          marginLeft: '326px',
          borderLeft: '1px solid black',
          borderRight: '1px solid black',
          borderBottom: '1px solid black', 

        }}
      >
        <Typography variant="h8">MISC Block</Typography>
      </Box>
    </Box>



  );
};

export default App;
